import React, { useState } from 'react';
import logo from './logo.svg';
import './App.css';
import List from './components/List';
import AddToList from './components/AddToList';

export interface IState {
  people: {
    name: string, 
    age: number, 
    url: string, 
    note? : string
  }[]
}

function App() {
  // const [number, setNumber] = useState<number>(5);  

  // const changeNumber = () => {
  //   setNumber(10)
  // }

  const [people, setPeople] = useState<IState["people"]>([
    {
      name : "Lenka",
      age: 24, 
      url : "https://i.pinimg.com/280x280_RS/83/32/35/833235a43e3aaf563eee130c430ba886.jpg",
      note: "I made this app!"
    }, {
      name: "You", 
      age: 0,
      url :"https://upload.wikimedia.org/wikipedia/commons/thumb/b/bc/Unknown_person.jpg/694px-Unknown_person.jpg",
      note: "Would love for you to come!"
    }, {
      name: "Bill Gates",
      age: 72, 
      url: "https://thumbor.forbes.com/thumbor/fit-in/416x416/filters%3Aformat%28jpg%29/https%3A%2F%2Fspecials-images.forbesimg.com%2Fimageserve%2F5f4ebe0c87612dab4f12a597%2F0x0.jpg%3Fbackground%3D000000%26cropX1%3D292%26cropX2%3D3684%26cropY1%3D592%26cropY2%3D3987",
      note: "Why not? Do you think he will come?"
    }
  ])

  return (
    <div className="App">
      <h1>People invited to my party</h1>
      <List people={people}/>
      <AddToList people={people} setPeople={setPeople} />
    </div>
  );
}

export default App;


// useState hook is responsible for storing data inside of a component 
// interface defines the syntax for classes to follow, they facilitate not just object-oriented programming but also type-checking 
// in react we pass data through props
